Using mongodb field values in update to get an index of an external array?<p>A novice mongodb developer here. I'm trying to write an update query where I search for stocks of certain products and decrease the quantities based on how many products are being sold. I have a products list which is a list of objects, it contains the products that are being sold.</p>
<pre><code>products= [
  {
    product: &quot;*some product id*&quot;,
    quantity: &quot;*some quantity*&quot;
  }
]
</code></pre>
<p>I extract product ids from the above list into a productIds list.
And below is how my query looks like. I have realized I can't pass &quot;$product&quot; [a field of the stock] into the indexof(), is there a way to handle this using update with an aggregation pipeline? If not what other options do I have ? I have searched the documentation but couldn't find anything helpful.</p>
<pre><code>Stock.updateOne(
      {
        product: { $in: productIds },
        quantity: { $gt: 0 },
      },
      [
        {
          $set: {
            newQuantity: {
              $subtract: [
                &quot;$quantity&quot;,
                products[productIds.indexOf(&quot;$product&quot;)].quantity,
              ],
            },
          },
        },
      ],
    );
</code></pre>

