How to fix bug with a class that writes to excel in Java<p>I currently want to fetch details of users in an asynchronous way and convert those details into an excel file.</p>
<p>Here is the method that fetches the details in batches from the db created in the repository.</p>
<pre><code>public CompletableFuture&lt;ArrayList&lt;UserProfile&gt;&gt; fetchUserDetailsBatches(Bson filter){
        return CompletableFuture.supplyAsync( () -&gt; {
            Bson projection = Projections.fields(Projections.exclude(&quot;roleGroup&quot;, &quot;roles&quot;));
            return this.userCollection.find(filter).projection(projection).skip(1).limit(1000).
                    into(new ArrayList&lt;&gt;());
        });
    }
</code></pre>
<p>Here is the class that converts to excel file. It was working pretty fine before now till when I was using Stream before I changed to CompleteFuture.</p>
<pre><code>public static InputStream writeToExcel(CompletableFuture&lt;ArrayList&lt;UserProfile&gt;&gt; data) throws Exception {
        //Blank workbook
        try (XSSFWorkbook workbook = new XSSFWorkbook()) {

            //Create a blank sheet
            XSSFSheet sheet = workbook.createSheet(&quot;userDetails report&quot;);

            AtomicInteger rowNum = new AtomicInteger(1);
            AtomicBoolean isHeaderSet = new AtomicBoolean(false);
            data.forEach(userProfile -&gt; {
                if (!isHeaderSet.get()){
                    createHeader(userProfile, sheet);
                    isHeaderSet.set(true);
                }
                XSSFRow row = sheet.createRow(rowNum.getAndIncrement());

                ObjectMapper mapObject = new ObjectMapper();
                Map&lt;String, Object&gt; mapObj = mapObject.convertValue(userProfile, Map.class);


                AtomicInteger cellNum = new AtomicInteger();
                mapObj.forEach((key, value) -&gt; {
                    XSSFCell cell = row.createCell(cellNum.getAndIncrement());
                    cell.setCellValue(key);
                    if (value instanceof Integer)
                        cell.setCellValue((Integer) value);
                    else if (value instanceof BigDecimal)
                        cell.setCellValue(((BigDecimal) value).doubleValue());
                    else if (value instanceof Long)
                        cell.setCellValue((Long) value);
                    else cell.setCellValue(String.valueOf(value));

                });
            });
            try {
                //Write the workbook in file system
                ByteArrayOutputStream bos = new ByteArrayOutputStream();
                workbook.write(bos);
                byte[] barray = bos.toByteArray();
                InputStream is = new ByteArrayInputStream(barray);
                log.info(&quot;userDetails.csv written successfully on disk.&quot;);
                return is;

            } catch (Exception e) {
                e.printStackTrace();
                throw new Exception(e.getMessage());
            }
        } catch (IOException e) {
            e.printStackTrace();
            throw new Exception(e.getMessage());

        }
    }
</code></pre>
<p>This error here has been fixed by @Cremer. The file that id being returned here, I want it to be saved in S3 buckets and a url link will be sent to the email of the user.</p>
<p>This is what I was doing but not working.</p>
