  &quot;_id&quot;:&quot;123&quot;, // the local key
  &quot;title&quot;:&quot;initialentity&quot;,
},
{ // CHILD ENTITY 
  &quot;_id&quot;:&quot;456&quot;,
  &quot;title&quot;:&quot;relatedentity&quot;,
  &quot;rels&quot;:[
    {
      &quot;r&quot;:&quot;123&quot;, // the foreign key
      &quot;a&quot;:&quot;exampledata-ignorethisfield&quot;,
    },
  ]
}
</code></pre>
<p>Aggregation:</p>
<pre><code>[
  { &quot;$lookup&quot;: {
    &quot;from&quot;: &quot;entities&quot;,
    &quot;let&quot;: { &quot;id&quot;: { $toString: &quot;$_id&quot; }  },
