How do you insert multiple objects into one mongoDB post request<p>I have built a workout tracker app, that allows you to create a session and in that session have multiple movements. I had my app connected to a airtable API, and have just started learning mongoDB and have transitioned over to that database. At the moment i am able to send a session, but it only logs one movement, not all that were sent.</p>
<p>Below is the code for my dynamic state for my session form.</p>
<pre><code>const [formData, setFormData] = useState([
    {
      movement: '',
      weight: '',
      rpe: '',
      reps: '',
      sets: '',
      notes: '',
      session: [
        &quot;&quot;
      ]
    }
  ])

const handleChange = (e, index) =&gt; {
    const { name, value } = e.target;
    const form = [...formData];
    form[index][name] = value;
    form[index].session[0] = sessionId;
    setFormData(form);
  };

  const handleAddInput = () =&gt; {
    setFormData([...formData,
      {
        movement: '',
        weight: '',
        rpe: '',
        reps: '',
        sets: '',
        notes: '',
        session: [
          ''
        ]
      }
    ]);
  };
</code></pre>
<p>Maping over state and inluding the movement in my body data for my API call i am able to get data to my database but it is only sending one. I understand why its only sending one. I just cant figure out any other way to include the data in the body for the API call. I have plundered google and cant find anything.</p>
<p>Below is my HandleSubmit for my form including the API call.</p>
<pre><code>const handleSessionSubmit = async (e) =&gt; {
    e.preventDefault()
    formData.forEach(async movement =&gt; {
      const sessionData = {
        sessionName,
        date,
        movements: [{ ...movement }]
      }
      const sessionPost = await api.post('/sessions', sessionData )
      console.log(sessionPost);

    })

    props.setToggle(prevToggle =&gt; !prevToggle)
      navigate('/')
    // }
  }
</code></pre>
<p>Below is the Database Schema</p>
<pre><code>import mongoose from 'mongoose'

const Schema = mongoose.Schema

const Movements = new Schema( 
  {
    movement: { type: String },
    weight: { type: String },
    reps: { type: String },
    rpe: { type: String },
    sets: { type: String },
    notes: { type: String },
  }
)

const Session = new Schema(
  {
    sessionName: { type: String },
    date: { type: String },
    movements: [ Movements ]
  },
  { timestamps: true}
)

export default mongoose.model('sessions', Session)
</code></pre>
