<p>My Schemas are as follows:</p>
<pre><code>const itemSchema = {
    name: String
};

const customListSchema ={
    name:String,
    items:[itemSchema]
};

const userSchema={
    username: String,
    password: String,
    nameOfUser: String,
    emailOfUser: String,
    userAllLists:  [customListSchema],
};
</code></pre>
<p>Thanks in Advance!</p>; Answer: Just replace `dispatch_semaphore_create` with `[self suspendExecution];` and `dispatch_semaphore_signal(sem);` with `[self resumeExecutionWithResult:result];` and delete `dispatch_semaphore_wait...`. It does exactly the same as the semaphore but in a native way. Maybe you might dispatch `resume` to the main thread.

